import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faCirclePlus } from '@fortawesome/free-solid-svg-icons';

const footer = () => {
    <div id="footer">
        <FontAwesomeIcon icon={faCirclePlus} size="4x"/>
    </div>
}

export default footer;
